import React from 'react'

const Song = (props) => {
    return (
        <div className="song-wrapper">
            <img src={props.props.cover} alt="" className="musicCover"/>
            <h2 >{props.props.name}</h2>
            <h3>{props.props.artist}</h3>
        </div>
    )
}

export default Song
